operations.body:
query People($count: Int!) {
  allPeople(first: $count) {
    edges {
      node {
        name
        __typename
      }
      __typename
    }
    __typename
  }
}

query Planets {
  allPlanets {
    totalCount
    edges {
      node {
        name
        climates
        population
        __typename
      }
      __typename
    }
    __typename
  }
}
